import React from "react";
import { Row, Col, Input, Modal, Typography } from "antd";

const { Text } = Typography;
const CustomModal = () => {
  return (
    <Modal
      visible={this.state.modal}
      onCancel={() => this.setState({ modal: false })}
      onOk={this.onSubmit}
    >
      <Row>
        <Col span={4}>
          <Text>Name:</Text>
        </Col>
        <Col span={6}>
          <Input value={item_data.name} onChange={this.onNameChange} />
        </Col>
      </Row>
      <Row>
        <Col span={4}>
          <Text>Order:</Text>
        </Col>
        <Col span={6}>
          <Input value={item_data.order} onChange={this.onOrderChange} />
        </Col>
      </Row>
    </Modal>
  );
};

export default CustomModal;
